import React from "react";

class Menu_bar extends React.Component {

    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div>
                <ul>
                    <li>
                        <button>Dashboard</button>
                    </li>
                    <li>
                        <button>Wszystkie lekcje</button>
                    </li>
                </ul>
            </div>
        )
    }

}

export default Menu_bar;
